import Carousel from 'react-bootstrap/Carousel';
import { useNavigate } from "react-router-dom";

const feather = require('feather-icons');

setTimeout(() => {
  feather.replace();
}, 1000);

const playas = [
  {
      name: "playa 1",
      slug: 'playa-1',
      description: "Descripcion playa 1",
      picture: 'https://s1.eestatic.com/2020/05/18/como/gatos-mascotas-trucos_490961518_152142875_1706x960.jpg'
  },
  {
      name: "Gato 2",
      slug: 'gato-2',
      description: "Descripcion Gato 2",
      picture: 'https://static.nationalgeographic.es/files/styles/image_3200/public/nationalgeographic_1468962.jpg?w=1600&h=900'
  },
  {
      name: "Gato 3",
      slug: 'gato-3',
      description: "Descripcion Gato 3",
      picture: 'https://fotografias.lasexta.com/clipping/cmsimages02/2019/01/25/DB41B993-B4C4-4E95-8B01-C445B8544E8E/69.jpg?crop=4156,2338,x0,y219&width=1280&height=720&optimize=high&format=webply'
  },
];


function UncontrolledExample() {
  return (

    <Carousel className='text-center'>
      <Carousel.Item>
      <br></br>
      <img
                src="https://static.vecteezy.com/system/resources/thumbnails/035/095/662/small_2x/ai-generated-copy-space-tropical-beach-landscape-ai-generative-photo.jpg" 
                style={{ width: '650px', height: '650px' }}
                alt="Playa"
            />


        <Carousel.Caption>
          <h3></h3>
          <p></p>

        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
      <br></br>
      <img
               src="https://i.pinimg.com/474x/17/f0/13/17f013312dfa35c8e242602bb7835ecc.jpg" 
                style={{ width: '650px', height: '650px' }}
                alt="Beach"
            />

        <Carousel.Caption>
          <h3></h3>
          <p></p>

        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
      <br></br>
      <img
                src="https://static.vecteezy.com/system/resources/thumbnails/038/252/827/small_2x/ai-generated-sunny-tropical-beach-sea-shells-photo.jpg" 
                style={{ width: '650px', height: '650px' }}
                alt="Relax"
            />

        <Carousel.Caption>
          <h3></h3>

          <p></p>

        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default UncontrolledExample;
